import { UPDATE_ORDER_NUMBER } from '../Actions/types';

const initialState = {
  orderNumber: null,
};

export const userSelection = (state = initialState, { type, payload }) => {
  switch (type) {
    case UPDATE_ORDER_NUMBER:
      return { ...state, orderNumber: payload };
    default:
      return state;
  }
};

export default userSelection;
